import './App.css';
import img1 from "./WhatsApp Image 2024-02-19 at 20.22.48.jpeg"// with import
import {Parallax,ParallaxLayer} from '@react-spring/parallax'
import { Application } from '@splinetool/runtime';


function App() {
  return (

          <div className='z-10 flex items-center justify-center h-screen'>
            <h1 className=" font-CormorantGaramond text-[200px] text-slate-700">Magda Nemes</h1>
            <Overlay></Overlay>
            <Background></Background>
           </div>

  );

}
function Overlay(){
  return(
  <div className='z-20 w-10 h-auto'>
        <img src={img1} alt="painting"></img>

  </div>
  )
}

function Background(){
<div>
  <script type="module" src="https://unpkg.com/@splinetool/viewer@1.0.80/build/spline-viewer.js"></script>
  <spline-viewer url="https://prod.spline.design/yBjFdZOrBHUQ2Pry/scene.splinecode"></spline-viewer>

</div>
}


export default App;
